import React from 'react';
import ReactDOM from 'react-dom';
import { Routes,Route,BrowserRouter } from 'react-router-dom';
import './index.css';
import App from './App';


function Home(){
  return(
    <BrowserRouter>
    <Routes>
      <Route exact path="/" component={App}></Route>
      </Routes>
    </BrowserRouter>
  )
}
ReactDOM.render(
  <>
    <Home />
  </>,
  document.getElementById('root')
);
